import React,{Component} from 'react'
import TodoItem from './todo-item';
import todoitem from './todo-item'

export default class TodoList extends Component {
    constructor(props) {
        super(props);
    }

    element = () => {
        const {id, title, done} = this.props;
        return (
            <li key={id}>
                <TodoItem title done></TodoItem>
            </li>
        )
    }

    render() {

        return (
            <ul>
                <TodoItem title done></TodoItem>
            </ul>
        )
    }
}
